const items = $input.all();
const timestamp = new Date().toISOString();
const startDate = $('Workflow Configuration').first().json.startDate;
const endDate = $('Workflow Configuration').first().json.endDate;

// Create CSV format
const csvHeaders = 'Category,Total Amount,Currency,Period Start,Period End';
const csvRows = items.map(item => 
  `${item.json.category},${item.json.amount},USD,${startDate},${endDate}`
);
const csvData = [csvHeaders, ...csvRows].join('\n');

// Create XML format
const xmlData = `<?xml version="1.0" encoding="UTF-8"?>
<TaxSubmission>
  <Period>
    <StartDate>${startDate}</StartDate>
    <EndDate>${endDate}</EndDate>
  </Period>
  <Revenue>
${items.map(item => `    <Category>
      <Name>${item.json.category}</Name>
      <Amount>${item.json.amount}</Amount>
      <Currency>USD</Currency>
    </Category>`).join('\n')}
  </Revenue>
  <Timestamp>${timestamp}</Timestamp>
</TaxSubmission>`;

// Create JSON payload
const jsonPayload = {
  period: {
    startDate: startDate,
    endDate: endDate
  },
  revenue: items.map(item => ({
    category: item.json.category,
    amount: item.json.amount,
    currency: 'USD'
  })),
  timestamp: timestamp
};

return [{
  json: {
    csv: csvData,
    xml: xmlData,
    jsonPayload: jsonPayload,
    timestamp: timestamp,
    totalRevenue: items.reduce((sum, item) => sum + item.json.amount, 0)
  }
}];
